import styled from "styled-components"
export const Wrapper = styled.div`

display: flex;
align-items: flex-center;
justify-content: space-between;
background:#1786b1;
color: #01474f;

`;

export const Title = styled.span`
padding-top: 60px;
color: #01474f;
font-weight: 800;

`;
